          src={banner}
          alt="Banner"
        />
      </div>
      <Layout className="App">
        <Content>
          <Card title={'Coronavirus disease (COVID-19)'} tabList={tabList} />
        </Content>
      </Layout>
    </>
  );
};
export default Home;
